import React, { useState } from "react";
import { collection, query, where, getDocs } from "firebase/firestore";
import { db } from "../init-firebase";
import Swal from "sweetalert2";

const DonersData = () => {
  const [city, setCity] = useState("");
  const [bloodGroup, setBloodGroup] = useState("");
  const [doners, setDoners] = useState([]);
  
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!bloodGroup || !city) {
         Swal.fire("Please add both city and blood group");
         return;
       }
   
       try {
         const filters = [];
         if (bloodGroup) {
           filters.push(where("DonerBloodGroup", "==", bloodGroup));
         }
         if (city) {
           filters.push(where("CityName", "==", city));
         }
   
         const matchData = query(collection(db, "BloodDoners"), ...filters);
         const querySnapshot = await getDocs(matchData);
   
         const matchedDonors = querySnapshot.docs.map((doc) => ({
           id: doc.id,
           DonerName: doc.data().DonerName,
           DonerBloodGroup: doc.data().DonerBloodGroup,
           CityName: doc.data().CityName,
           ContactNo: doc.data().ContactNo,
         }));
   
         if (matchedDonors.length === 0) {
           Swal.fire("No donors found matching your criteria.");
         } else {
           setDonors(matchedDonors);
         }
       } catch (error) {
         console.error("Error fetching donors:", error);
         Swal.fire("Error", "Failed to fetch data", "error");
       }
     };
  

  return (
    <div className="contact-us-container">
      <h2 className="text-2xl font-bold mb-4">Find Blood Donors or Receivers</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block text-gray-700 font-medium">City</label>
          <input
            type="text"
            className="w-full border border-gray-300 rounded-lg px-4 py-2"
            placeholder="Enter your city"
            value={city}
            onChange={(e) => setCity(e.target.value)}
            required
          />
        </div>
        <div>
          <label className="block text-gray-700 font-medium">Blood Group</label>
          <input
            type="text"
            className="w-full border border-gray-300 rounded-lg px-4 py-2"
            placeholder="Enter blood group (e.g., A+, O-)"
            value={bloodGroup}
            onChange={(e) => setBloodGroup(e.target.value)}
            required
          />
        </div>
        <button
          type="submit"
          className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600"
        >
          Search
        </button>
      </form>

      <div className="mt-6">
        {results.length > 0 ? (
          <div>
            <h3 className="text-lg font-bold">Matching Results:</h3>
            <ul className="mt-4 space-y-2">
              {results.map((result, index) => (
                <li
                  key={index}
                  className="p-4 border border-gray-300 rounded-lg shadow-md"
                >
                  <p>
                    <strong>Name:</strong> {result.name}
                  </p>
                  <p>
                    <strong>City:</strong> {result.city}
                  </p>
                  <p>
                    <strong>Blood Group:</strong> {result.bloodGroup}
                  </p>
                  <p>
                    <strong>Contact:</strong> {result.email}
                  </p>
                </li>
              ))}
            </ul>
          </div>
        ) : (
          <p className="text-gray-600 mt-4">No results to display.</p>
        )}
      </div>
    </div>
  );
};

export default DonersData;
